Actionscript.script:
onClipEvent(enterFrame){
   _parent.攻击时移动(45,30);
}

function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      _parent.移动("右",慢速度);
   }
   else if(_parent.方向 == "左")
   {
      _parent.移动("左",慢速度);
   }
}
function 近战攻击(倍率)
{
	var 子弹 = _root.子弹属性初始化(this.攻击点);
	if(!倍率){
		倍率 = 1;
	}
	子弹.声音 = "";
	子弹.霰弹值 = 霰弹值;
	子弹.子弹散射度 = 0;
	子弹.子弹种类 = "近战子弹";
	子弹.子弹威力 = _parent.空手攻击力 * 倍率;
	子弹.子弹速度 = 0;
	子弹.击中地图效果 = "";
	子弹.Z轴攻击范围 = 30;
	子弹.击倒率 = 10;
	子弹.击中后子弹的效果 = "空手攻击火花";
	子弹.区域定位area = this.攻击点;

	_root.子弹区域shoot传递(子弹);
}
function 近战联弹攻击(倍率, 霰弹值)
{
	var 子弹 = _root.子弹属性初始化(this.攻击点);
	if(!倍率){
		倍率 = 1;
	}
	if(!霰弹值){
		霰弹值 = 1;
	}
	子弹.声音 = "";
	子弹.霰弹值 = 霰弹值;
	子弹.子弹散射度 = 0;
	子弹.子弹种类 = "近战联弹";
	子弹.子弹威力 = _parent.空手攻击力 * 倍率;
	子弹.子弹速度 = 0;
	子弹.击中地图效果 = "";
	子弹.Z轴攻击范围 = 30;
	子弹.击倒率 = 10;
	子弹.击中后子弹的效果 = "空手攻击火花";
	子弹.区域定位area = this.攻击点;

	_root.子弹区域shoot传递(子弹);
}

gotoAndPlay(_parent.近战招式);

兵种 = "敌人-黑无常索命";
名字 = "浮士德";
僵尸型敌人newname = _parent._name + 兵种;
_root.gameworld[僵尸型敌人newname].removeMovieClip();
_parent.黑无常索命对象 = _root.加载游戏世界人物(兵种, 僵尸型敌人newname, _root.gameworld.getNextHighestDepth(), {
	_x:_root.gameworld[_parent.攻击目标]._x + 1 + random(10), 
	_y:_root.gameworld[_parent.攻击目标]._y, 
	等级:_parent.等级, 
	名字:this.名字, 
	是否为敌人:_parent.是否为敌人, 
	身高:_parent.身高, 
	产生源:_parent._name
});

if (_parent._x > _root.gameworld[_parent.攻击目标]._x)
{
	_parent.方向改变("右");
}
else if (_parent._x < _root.gameworld[_parent.攻击目标]._x)
{
	_parent.方向改变("左");
}

