onClipEvent (load) {
	var 子弹属性 = _root.子弹属性初始化(this);

	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.发射效果 = "";
	子弹属性.子弹种类 = "白无常索命";
	子弹属性.子弹威力 = _parent._parent.空手攻击力 * 3;
	子弹属性.子弹速度 = 0;
	子弹属性.击中地图效果 = "";
	子弹属性.Z轴攻击范围 = 30;
	子弹属性.击倒率 = 5;
	子弹属性.击中后子弹的效果 = "空手攻击火花";
	子弹属性.子弹敌我属性 = !_parent._parent.是否为敌人;

	var 攻击对象 = _root.gameworld[_parent._parent.攻击目标];
	//等级到达30解锁追踪攻击
	if (_parent._parent.等级 > 29 && 攻击对象.Z轴坐标)
	{
		子弹属性.shootX = 攻击对象._x;
		子弹属性.shootZ = 子弹属性.shootY = 攻击对象.Z轴坐标;
	}
	else
	{
		子弹属性.shootZ = 子弹属性.shootY = _parent._parent.Z轴坐标;
	}

	_parent._parent.白无常索命对象 = _root.子弹区域shoot传递(子弹属性);
}

onClipEvent(load){
   声音 = "m4a1-1.wav";
   霰弹值 = 3;
   子弹散射度 = 5;
   发射效果 = "";
   子弹种类 = "纵向联弹-穿刺子弹";
   子弹威力 = _parent._parent.空手攻击力;
   子弹速度 = -20;
   击中地图效果 = "火花";
   Z轴攻击范围 = 25;
   击倒率 = 100;
   击中后子弹的效果 = "";
   if(_parent._parent.是否为敌人 == true)
   {
      子弹敌我属性 = false;
   }
   else
   {
      子弹敌我属性 = true;
   }
   var myPoint = {x:this._x,y:this._y};
   _parent.localToGlobal(myPoint);
   _root.gameworld.globalToLocal(myPoint);
   shootX = myPoint.x;
   shootY = myPoint.y;
   _root.子弹区域shoot(声音,霰弹值,子弹散射度,发射效果,子弹种类,子弹威力,子弹速度,Z轴攻击范围,击中地图效果,_parent._parent._name,shootX,shootY,_parent._parent.Z轴坐标,子弹敌我属性,击倒率,击中后子弹的效果);
}

